// src/components/Auth/Login.js
import React, { useState } from 'react'; 
import axios from 'axios';
import { useNavigate } from 'react-router-dom'; // Importamos useNavigate
import '../../styles.css'; // Asegúrate de importar el archivo CSS

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate(); // Hook para redirigir

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/auth/login', {
        email,
        password,
      });

      const token = response.data.token;
      // Guardamos el token en el localStorage
      localStorage.setItem('token', token);
      console.log('Login exitoso, token:', token);

      // Redirigir al Dashboard después de un login exitoso
      navigate('/dashboard');
    } catch (error) {
      console.error('Login error:', error.response?.data || error.message);
      alert('Error al iniciar sesión, por favor revisa tus credenciales');
    }
  };

  // Función para manejar la redirección al SignUp
  const handleGoToSignUp = () => {
    navigate('/signup'); // Redirige al componente SignUp
  };

  return (
    <section className="py-12 py-lg-24 py-xl-32 position-relative overflow-hidden">
      <div className="container">
        <div className="mw-md mx-auto mw-lg-none">
          <div className="row align-items-center">
            <div className="col-lg-6 order-last order-lg-first">
              <div className="mw-md mw-xl-none position-relative">
                <div className="position-absolute bottom-0 start-0 w-100 p-6">
                  <div className="py-10 px-6 px-sm-10 bg-dark bg-opacity-25 rounded">
                    <h6 className="text-white">IA para analizar dibujos</h6>
                    <p className="fs-5 text-white fw-semibold mb-14">
                      "Sistemas de inteligencia artificial diseñados para interpretar y comprender imágenes... utilizan técnicas de visión por computadora y aprendizaje automático para extraer..."
                    </p>
                  </div>
                </div>
                <img
                  className="img-fluid d-block w-100"
                  style={{ minHeight: 620, objectFit: 'cover' }}
                  src="saturn-assets/images/sign-up/image-face.png"
                  alt=""
                />
              </div>
            </div>
            <div className="col-lg-6 mb-12 mb-lg-0">
              <div className="mw-md mw-xl-lg ms-xl-auto">
                <h5 className="font-heading mb-4">Log in to your account</h5>
                <div className="row mb-6 flex-column flex-sm-row"></div>
                <div className="d-flex mb-6 align-items-center">
                  <div className="border-top w-100" />
                  <div className="border-top w-100" />
                </div>
                <form onSubmit={handleLogin}>
                  <div className="mb-6">
                    <label className="fw-semibold fs-9 mb-1" htmlFor="email">Email</label>
                    <input
                      className="form-control"
                      type="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      id="email"
                      placeholder="pat@saturn.dev"
                      required
                    />
                  </div>
                  <div className="mb-8">
                    <div className="d-flex mb-1 justify-content-between">
                      <label className="fw-semibold fs-9" htmlFor="password">Password</label>
                    </div>
                    <input
                      className="form-control"
                      type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      id="password"
                      placeholder="Enter your password"
                      required
                    />
                  </div>
                  <button className="btn btn-primary mb-6 w-100 rounded-pill" type="submit">Login</button>
                  <p className="fs-10 fw-semibold">
                    <span>Don’t have an account?</span>
                    <button 
                      className="btn btn-link fw-semibold fs-10 p-0" 
                      type="button" 
                      onClick={handleGoToSignUp}
                    >
                      Sign up
                    </button>
                  </p>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Login;
